        des:"Chapter 125",
        view: "1000212",
        picture:"chuong1.jpg",
      },
      {
        id: 4,
        ISBN: "ABCXYZ",
        category: "action",
        name: "Kengan Omega",
        author: "Nogul",
        dob: Date,
        des:"Chapter 126",
        view: "123123",
        picture:"chuong1.jpg",
      },
      {
        id: 5,
        ISBN: "ABCXYZ",
